import React from "react";
import web from "../src/images/aboutUs.jpg";

const About = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col-md-4">{web}</div>
          <div className="col-md-8"></div>
        </div>
      </div>
    </>
  );
};

export default About;
